import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import { BrowserRouter, Switch, Redirect, Route } from 'react-router-dom';

function App() {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Switch>
          <Navbar/>
        </Switch>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
